export const MainMenu = () => {

    let dayInfo = new Date();

    setTimeout(() => {

        console.log(new Date());

        dayInfo = new Date(), 10000
    });

    return <ul>
        <li>{dayInfo.toLocaleTimeString()}</li>
        <li>Time</li>
        <li>Projects</li>
        <li>Reports</li>
    </ul>
}
